pragma solidity ^0.4.24;
import "../SharedContracts/VuupleAdmins.sol";
import "../SharedContracts/VuupleToken.sol";
// import "../../node_modules/openzeppelin-solidity/contracts/access/roles/MinterRole.sol";
import "./RenterRegistration.sol";
contract RenterFactory{
    VuupleAdmins public vuupleAdmin;
    VuupleToken public vuupleToken;
    uint public renterIndex =0;

    // MinterRole private minters;

    mapping (address=>address) rentersToContracts;
    constructor( VuupleAdmins _adminAddress,  VuupleToken _vuupleToken ){
        vuupleAdmin =_adminAddress;
        vuupleToken=   _vuupleToken ;
// TODO: adding contract to minter group will be done monually on migration
        //vuupleToken.addMinter(this);
    }

    modifier isNewRenter{
        require(rentersToContracts[msg.sender] == address(0));
        _;
    }
    function renterRegister(uint256 _type ) public isNewRenter returns (bool) {
        /**, uint256 _type,uint256 _renewalDate , VuupleAdmins _adminAddress, VuupleToken _vuupleToken , _ */
        rentersToContracts[msg.sender]= new RenterRegistration(  _type,vuupleAdmin, vuupleToken ,msg.sender);
        renterIndex++;
        return true;
    }
    function getRenterContract(address renterAddress) returns (address ) {
        return rentersToContracts[renterAddress];
    }

}
